export default function(){
    return [
        {
            id: 1,
            due: 'no due date',
            text: 'do this'
        },
        {
            id: 2,
            due: 'no due date',
            text: 'do that'
        },
        {
            id: 3,
            due: 'april 1st',
            text: 'do them'
        }
    ]
}
